<template>    <!--    版本选择    -->    <div class="mt-[15px] flex items-center">        <div class="mr-[10px] text-base">版本选择</div>        <el-select v-model="value" placeholder="请选择版本" class="flex-1">            <el-option                v-for="(value, key) in versionList"                :key="value"                :label="key"                :value="value"            />        </el-select>    </div></template><script setup lang="ts">import { useVModels } from '@vueuse/core'const emit = defineEmits<{    (event: 'update:modelValue', value: string): void}>()const props = withDefaults(    defineProps<{        modelValue?: any        versionList?: any    }>(),    {        modelValue: '',        versionList: []    })const { modelValue: value } = useVModels(props, emit)watchEffect(() => {    const obj = props.versionList    value.value = obj['v1'] || obj[Object.keys(obj)[0]]})</script><style scoped></style>